import styled from 'styled-components';
import { breakpoints } from '../../../styles/theme/theme';

export const Container = styled.nav`
  height: 4.8rem;
  width: 100vw;
  background-color: ${(props) => props.theme.colors.primary.one};
  display: flex;
  padding: 12px 32px;

  display: flex;
  justify-content: space-between;
  align-items: center;
`;
